import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Table from './Table';

// import './App.css';


function App() {
  const [ state, setState ] = useState({
    sortBy: 'in_frame',
    order: 'asc',
    filterLocation: '',
    pageNumber: 1,
    pageSize: 10,
  });

  useEffect (() => {
    const {
      sortBy,
      order,
      filterLocation,
      pageNumber,
      pageSize,
    } = state;

    axios.get({
      url: '/data',
      params: { sortBy, order, filterLocation, pageNumber, pageSize },
    })
      .then((data) => {
        console.log(data);
        setState({ data });
      });
  }, []);

  return (
    <div className="App">
      <Table data={state.data} />
    </div>
  );
}

export default App;
